import './App.css'
import Calendar from './Components/Calendar';
import Deadline from './Components/Deadline';
import Header from './Components/Header';
import MyDiary from './Components/MyDiary/MyDiary';
import { useSelector } from 'react-redux';

function App() {

    const {mouseOverDeadline, showMoveLeft, showMoveRight} = useSelector((state)=> state.uiSlice)
    const {userLoggedIn} = useSelector((state)=> state.userSlice)

    return (
        <div className="App">
            <Header/>
            <div className='timeline'>

                {
                    userLoggedIn && showMoveLeft && <button className='move-left'>
                        <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="3" stroke="currentColor" class="w-6 h-6">
                        <path stroke-linecap="round" stroke-linejoin="round" d="M15.75 19.5L8.25 12l7.5-7.5" />
                        </svg>
                    </button>
                }

                <MyDiary/>
                <Calendar/>
                {/* <Deadline/> */}
                <div className={`Calendar-details ${mouseOverDeadline ? "Calendar-details-2" : ""}`}>
                    <p>Date</p>
                    <p>Date</p>
                    <p>Date</p>
                </div>

                {
                    userLoggedIn && showMoveRight && <button className='move-right'>
                        <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="3" stroke="currentColor" class="w-6 h-6">
                        <path stroke-linecap="round" stroke-linejoin="round" d="M8.25 4.5l7.5 7.5-7.5 7.5" />
                        </svg>
                    </button>
                }
            </div>
        </div>
    );
}

export default App;
